import {React, Component} from 'react';

class Results extends Component {
	
	render(){
		return(
			<div>{this.props.data.map((business) => {
				return (
				  <li key={business.id} className='list'>
					<span className='repo-text'>{business.name} </span>
					<span className='repo-description'>{business.address}</span>
				  </li>
				);
			})}
			</div>
		)
	}
	
}

export default Results;
